css:
.git-commit input[type="text"] {
  width: 100%;
  background: #282c34;
  color: #9da5b4;
  margin: 0px;
  outline: 0px;
  padding: 5px 12px;
  border: 0px;
  border-radius: 5px;
}
.git-commit input[type="text"]::-webkit-input-placeholder {
  color: rgba(157, 165, 180, 0.6);
}
.git-commit input[type="checkbox"] {
  -webkit-appearance: none;
  display: inline-block;
  position: relative;
  font-size: inherit;
  width: 2.8em;
  height: 1.4em;
  cursor: pointer;
  outline: 0;
  border-radius: 2em;
  background-color: rgba(157, 165, 180, 0.6);
  transition: background-color 0.2s cubic-bezier(0.5, 0.15, 0.2, 1);
}
.git-commit input[type="checkbox"]:focus:before {
  background-color: #ffffff;
}
.git-commit input[type="checkbox"]:active {
  box-shadow: none;
}
.git-commit input[type="checkbox"]:before {
  content: "";
  position: absolute;
  box-sizing: border-box;
  display: inline-block;
  left: 0;
  margin: 0;
  width: 1.4em;
  height: inherit;
  border-radius: inherit;
  border: 4px solid transparent;
  background-clip: content-box;
  background-color: #282c34;
  transition: transform 0.2s cubic-bezier(0.5, 0.15, 0.2, 1);
}
.git-commit input[type="checkbox"]:checked {
  background-color: #20b684;
}
.git-commit input[type="checkbox"]:checked:before {
  transform: translate3d(100%, 0, 0);
}
.git-commit input[type="checkbox"]:before {
  top: 0;
  opacity: 1;
  transform: none;
}
.git-commit input[type="checkbox"]:after {
  content: none;
}
